import { Button, TextField } from "@material-ui/core"
import { useState } from "react"


const NewCourse = () => {
    const [mamonhoc, setMamonhoc] = useState('')
    const [tenmonhoc, setTenmonhoc] = useState('')
    const [tinchi, setTinchi] = useState(null)
    const [phanloai, setPhanloai] = useState('')
    const [mota, setMota] = useState('')
    const [bomon, setBomon] = useState('')
    const [post, setPost] = useState(false)

    const handleSubmit = e => {

    }

    return <>
        <div>
            <h3 className="page-title">
                Them mon hoc
            </h3>
            <hr />
        </div>
        <div>
            <form>
                <TextField value={mamonhoc} onClick={e => setMamonhoc(e.value)} label="Mã môn học" />
                <TextField value={tenmonhoc} onClick={e => setTenmonhoc(e.value)} label="Tên môn học" />
                <TextField value={tinchi} onClick={e => setTinchi(e.value)} type="number" label="Số tín chỉ" />
                <TextField value={phanloai} onClick={e => setPhanloai(e.value)} label="Phân loại" />
                <TextField value={mota} onClick={e => setMota(e.value)} label="Mô tả" multiline />
                <TextField value={bomon} onClick={e => setBomon(e.value)} label="Bộ môn" />
                <Button onClick={handleSubmit} variant="contained" color="primary" fullWidth>Tạo</Button>
            </form>
        </div>
    </>
}

export default NewCourse
